"use strict";const upcomingWebinars=document.querySelectorAll(".upcoming-webinars .webinars-list"),pastWebinars=document.querySelectorAll(".past-webinars .webinars-list");let clientWidth=document.body.clientWidth;function searchWebinars(e){let i=[];return e.forEach(e=>{for(var n=0;n<e.childNodes.length;n++)"webinar"==e.childNodes[n].className&&(i.push(e.childNodes[n]),n++)}),i}function sortWebinar(e){searchWebinars(e).forEach((e,i)=>{i>2&&(e.style.display="none")})}function hideWebinarsOnMobile(e,i){i<810&&sortWebinar(e)}hideWebinarsOnMobile(upcomingWebinars,clientWidth),hideWebinarsOnMobile(pastWebinars,clientWidth),window.addEventListener("resize",()=>{clientWidth=document.body.clientWidth,hideWebinarsOnMobile(upcomingWebinars,clientWidth),hideWebinarsOnMobile(pastWebinars,clientWidth)});